function square (props)
{
	return (
		<div style={{ width: 100, height: 100, overflow: 'hidden' }}> 
			<img
				source={props.fruit}
				style={{
					top: 24,
					left: 32,
				}} //position of image you want display.
				/>
			</div>    );
}
export default square;
